import React from 'react';
import './App.module.css';
import Navigation from './components/Navigation'; 
import Form from './components/Form';
import {withRouter } from 'react-router-dom';
import Banner from './components/Banner';

function App() {
  return (
    <div>
      <div>
        <Banner />
      </div>
      <nav>
        <Navigation />
      </nav>
      <main>
        <Form />
      </main>
    </div>
  );
}

export default App;
